$templateCache.put("components/angular-datatables-master/demo/withPlugins/bootstrapIntegration.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Bootstrap integration</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            Angular Datables can also be compatible with <a href=\"http://getbootstrap.com\">Twitter Bootstrap 3</a>.\n        </p>\n        <p>\n            You need to add the files <code>angular-datatables.bootstrap.min.js</code> and <code>datatables.bootstrap.min.css</code>\n            to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.bootstrap</code> to your Angular app.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"BootstrapIntegrationCtrl as showCase\">\n                        <table datatable=\"\" dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"table table-striped table-bordered\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"vendor/bootstrap/dist/css/bootstrap.min.css\">\n<link rel=\"stylesheet\" href=\"vendor/angular-datatables/dist/plugins/bootstrap/datatables.bootstrap.min.css\">\n<!-- ... -->\n<div ng-controller=\"BootstrapIntegrationCtrl as showCase\">\n    <table datatable=\"\" dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"table table-striped table-bordered\"></table>\n</div>\n<!-- ... -->\n<script src=\"vendor/angular-datatables/dist/plugins/bootstrap/angular-datatables.bootstrap.min.js\"></script>\n<script src=\"vendor/bootstrap/dist/js/bootstrap.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.bootstrapIntegration\', [\'datatables\', \'datatables.bootstrap\'])\n.controller(\'BootstrapIntegrationCtrl\', BootstrapIntegrationCtrl);\n\nfunction BootstrapIntegrationCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder\n        .fromSource(\'data.json\')\n        // Add Bootstrap compatibility\n        .withBootstrap();\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\').withClass(\'text-danger\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/overrideBootstrapOptions.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Override Bootstrap options</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            With bootstrap integration, angular-datatables overrides classes so that it uses Bootstrap classes instead of DataTables\'.\n            However, you can also override the classes used by using the helper <code>DTOption.withBootstrapOptions</code>.\n        </p>\n        <p>\n            <i class=\"fa fa-info-circle\"></i>&nbsp;Angular-datatables provides default properties for Bootstrap compatibility.\n            You can check them out on <a href=\"https://github.com/l-lin/angular-datatables/blob/dev/src/angular-datatables.bootstrap.options.js\">Github</a>.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithBootstrapOptionsCtrl as showCase\">\n                        <table datatable=\"\" dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"table table-striped table-bordered\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"vendor/bootstrap/dist/css/bootstrap.min.css\">\n<link rel=\"stylesheet\" href=\"vendor/angular-datatables/dist/plugins/bootstrap/datatables.bootstrap.min.css\">\n<!-- ... -->\n<div ng-controller=\"WithBootstrapOptionsCtrl as showCase\">\n    <table datatable=\"\" dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"table table-striped table-bordered\"></table>\n</div>\n<!-- ... -->\n<script src=\"vendor/angular-datatables/dist/plugins/bootstrap/angular-datatables.bootstrap.min.js\"></script>\n<script src=\"vendor/bootstrap/dist/js/bootstrap.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.overrideBootstrapOptions\', [\'datatables\', \'datatables.bootstrap\'])\n.controller(\'WithBootstrapOptionsCtrl\', WithBootstrapOptionsCtrl);\n\nfunction WithBootstrapOptionsCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder\n        .fromSource(\'data.json\')\n        .withDOM(\'<\\\'row\\\'<\\\'col-xs-6\\\'l><\\\'col-xs-6\\\'f>r>t<\\\'row\\\'<\\\'col-xs-6\\\'i><\\\'col-xs-6\\\'p>>\')\n        // Add Bootstrap compatibility\n        .withBootstrap()\n        .withBootstrapOptions({\n            TableTools: {\n                classes: {\n                    container: \'btn-group\',\n                    buttons: {\n                        normal: \'btn btn-danger\'\n                    }\n                }\n            },\n            ColVis: {\n                classes: {\n                    masterButton: \'btn btn-primary\'\n                }\n            },\n            pagination: {\n                classes: {\n                    ul: \'pagination pagination-sm\'\n                }\n            }\n        })\n\n        // Add ColVis compatibility\n        .withColVis()\n\n        // Add Table tools compatibility\n        .withTableTools(\'vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\')\n        .withTableToolsButtons([\n            \'copy\',\n            \'print\', {\n                \'sExtends\': \'collection\',\n                \'sButtonText\': \'Save\',\n                \'aButtons\': [\'csv\', \'xls\', \'pdf\']\n            }\n        ]);\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\').withClass(\'text-danger\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withAngularTranslate.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With <a href=\"http://angular-translate.github.io\">Angular Translate</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            You can use <code>Angular Translate</code> with Angular DataTables seamlessly.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithAngularTranslateCtrl as showCase\">\n                        <table datatable=\"\" dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"table table-striped table-bordered\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"WithAngularTranslateCtrl as showCase\">\n    <table datatable=\"\" dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"table table-striped table-bordered\"></table>\n</div>\n<!-- ... -->\n<script src=\"vendor/angular-translate/angular-translate.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase\', [\'datatables\', \'pascalprecht.translate\'])\n.config(translateConfig)\n.controller(\'WithAngularTranslateCtrl\', WithAngularTranslateCtrl);\n\nfunction translateConfig($translateProvider) {\n    $translateProvider.translations(\'en\', {\n        id: \'ID with angular-translate\',\n        firstName: \'First name with angular-translate\',\n        lastName: \'Last name with angular-translate\'\n    });\n    $translateProvider.preferredLanguage(\'en\');\n}\n\nfunction WithAngularTranslateCtrl(DTOptionsBuilder, DTColumnBuilder, $translate) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\');\n    vm.dtColumns = [\n        // You can provide the title directly in the newColum second parameter\n        DTColumnBuilder.newColumn(\'id\', $translate(\'id\')),\n        // Or you can use the withTitle helper\n        DTColumnBuilder.newColumn(\'firstName\').withTitle($translate(\'firstName\')),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle($translate(\'lastName\'))\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withAngularTranslateSwitchLanguage.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Switching language with <a href=\"http://angular-translate.github.io\">Angular Translate</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            Unfortunately, it\'s not possible (for now?) to switch language if you define the title of the columns in\n            the controller. Only by providing the titles directly in the HTML code can you switch the language.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithAngularTranslateSwitchLanguageCtrl as showCase\">\n                        <div class=\"form-horizontal\">\n                            <div class=\"form-group\">\n                                <label class=\"col-sm-2 control-label\">Choose a language:</label>\n                                <div class=\"col-sm-3\">\n                                    <select class=\"form-control\" ng-model=\"showCase.lang\" ng-change=\"showCase.switchLanguage(showCase.lang)\">\n                                        <option value=\"en\">English</option>\n                                        <option value=\"fr\">French</option>\n                                    </select>\n                                </div>\n                            </div>\n                        </div>\n                        <table datatable\n                               dt-options=\"showCase.dtOptions\"\n                               dt-columns=\"showCase.dtColumns\"\n                               class=\"table table-striped table-bordered\">\n                            <thead>\n                            <tr>\n                                <th>{{ \'id\' | translate }}</th>\n                                <th>{{ \'firstName\' | translate }}</th>\n                                <th>{{ \'lastName\' | translate }}</th>\n                            </tr>\n                            </thead>\n                        </table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"WithAngularTranslateSwitchLanguageCtrl as showCase\">\n    <div class=\"form-horizontal\">\n        <div class=\"form-group\">\n            <label class=\"col-sm-2 control-label\">Choose a language:</label>\n            <div class=\"col-sm-3\">\n                <select class=\"form-control\" ng-model=\"showCase.lang\" ng-change=\"showCase.switchLanguage(showCase.lang)\">\n                    <option value=\"en\">English</option>\n                    <option value=\"fr\">French</option>\n                </select>\n            </div>\n        </div>\n    </div>\n    <table datatable\n           dt-options=\"showCase.dtOptions\"\n           dt-columns=\"showCase.dtColumns\"\n           class=\"table table-striped table-bordered\">\n        <thead>\n        <tr>\n            <th>{{ \'id\' | translate }}</th>\n            <th>{{ \'firstName\' | translate }}</th>\n            <th>{{ \'lastName\' | translate }}</th>\n        </tr>\n        </thead>\n    </table>\n</div>\n<!-- ... -->\n<script src=\"vendor/angular-translate/angular-translate.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase\', [\'datatables\', \'pascalprecht.translate\'])\n.config(translateConfig)\n.controller(\'WithAngularTranslateSwitchLanguageCtrl\', WithAngularTranslateSwitchLanguageCtrl);\n\nfunction translateConfig($translateProvider) {\n    $translateProvider.translations(\'en\', {\n        id: \'ID with angular-translate\',\n        firstName: \'First name with angular-translate\',\n        lastName: \'Last name with angular-translate\'\n    });\n    $translateProvider.translations(\'fr\', {\n        id: \'ID avec angular-translate\',\n        firstName: \'Prnom avec angular-translate\',\n        lastName: \'Nom avec angular-translate\'\n    });\n    $translateProvider.preferredLanguage(\'en\');\n}\n\nfunction WithAngularTranslateSwitchLanguageCtrl(DTOptionsBuilder, DTColumnBuilder, $translate) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\');\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\'),\n        DTColumnBuilder.newColumn(\'firstName\'),\n        DTColumnBuilder.newColumn(\'lastName\')\n    ];\n    vm.switchLanguage = switchLanguage;\n    vm.lang = \'en\';\n\n    function switchLanguage(lang) {\n        $translate.use(lang);\n    }\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withButtons.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1>\n            <i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/buttons/\">Buttons</a>\n        </h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>Buttons</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.buttons.min.js</code> to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.buttons</code> to your Angular app.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithButtonsCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"https://cdn.datatables.net/buttons/1.2.2/css/buttons.dataTables.min.css\">\n<!-- ... -->\n<div ng-controller=\"WithButtonsCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n</div>\n<!-- ... -->\n<script src=\"https://cdn.datatables.net/buttons/1.2.2/js/dataTables.buttons.min.js\"></script>\n<script src=\"https://cdn.datatables.net/buttons/1.2.2/js/buttons.colVis.min.js\"></script>\n<script src=\"https://cdn.datatables.net/buttons/1.2.2/js/buttons.flash.min.js\"></script>\n<script src=\"https://cdn.datatables.net/buttons/1.2.2/js/buttons.html5.min.js\"></script>\n<script src=\"https://cdn.datatables.net/buttons/1.2.2/js/buttons.print.min.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/buttons/angular-datatables.buttons.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withButtons\', [\'datatables\', \'datatables.buttons\'])\n    .controller(\'WithButtonsCtrl\', WithButtonsCtrl);\n\nfunction WithButtonsCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withDOM(\'frtip\')\n        .withPaginationType(\'full_numbers\')\n        // Active Buttons extension\n        .withButtons([\n            \'columnsToggle\',\n            \'colvis\',\n            \'copy\',\n            \'print\',\n            \'excel\',\n            {\n                text: \'Some button\',\n                key: \'1\',\n                action: function (e, dt, node, config) {\n                    alert(\'Button activated\');\n                }\n            }\n        ]);\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withColReorder.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/colreorder/\">ColReorder</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>ColReorder</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.colreorder.min.js</code> to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.colreorder</code> to your Angular app.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithColReorderCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"https://cdn.datatables.net/colreorder/1.3.2/css/colReorder.dataTables.min.css\">\n<!-- ... -->\n<div ng-controller=\"WithColReorderCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n</div>\n<!-- ... -->\n<script src=\"https://cdn.datatables.net/colreorder/1.3.2/js/dataTables.colReorder.min.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/colreorder/angular-datatables.colreorder.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withColReorder\', [\'datatables\', \'datatables.colreorder\'])\n.controller(\'WithColReorderCtrl\', WithColReorderCtrl);\n\nfunction WithColReorderCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        // Activate col reorder plugin\n        .withColReorder()\n        // Set order\n        .withColReorderOrder([1, 0, 2])\n        // Fix last right column\n        .withColReorderOption(\'iFixedColumnsRight\', 1)\n        .withColReorderCallback(function() {\n            console.log(\'Columns order has been changed with: \' + this.fnOrder());\n        });\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'No move me!\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'Try to move me!\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'You cannot move me! *evil laugh*\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withColumnFilter.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"http://jquery-datatables-column-filter.googlecode.com/svn/trunk/index.html\">Column Filter</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>ColumnFilter</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.columnfilter.min.js</code> to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.columnfilter</code> to your Angular app.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithColumnFilterCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\">\n                            <tfoot>\n                            <tr>\n                                <th>ID\n                                <th>First Name\n                                <th>Last Name\n                            </tr>\n                            </tfoot>\n                        </table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"WithColumnFilterCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\">\n        <tfoot>\n        <tr>\n            <th>ID\n            <th>First Name\n            <th>Last Name\n        </tr>\n        </tfoot>\n    </table>\n</div>\n<!-- ... -->\n<script src=\"vendor/datatables-columnfilter/js/dataTables.columnFilter.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/columnfilter/angular-datatables.columnfilter.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withColumnFilter\', [\'datatables\', \'datatables.columnfilter\'])\n.controller(\'WithColumnFilterCtrl\', WithColumnFilterCtrl);\n\nfunction WithColumnFilterCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        .withColumnFilter({\n            aoColumns: [{\n                type: \'number\'\n            }, {\n                type: \'text\',\n                bRegex: true,\n                bSmart: true\n            }, {\n                type: \'select\',\n                bRegex: false,\n                values: [\'Yoda\', \'Titi\', \'Kyle\', \'Bar\', \'Whateveryournameis\']\n            }]\n        });\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
