$templateCache.put("components/angular-datatables-master/demo/withPlugins/withFixedHeader.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/fixedheader/\">Fixed Header</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>FixedHeader</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.fixedheader.min.js</code> to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.fixedheader</code> to your Angular app.\n        </p>\n        <div class=\"api alert alert-danger\">\n            <p>\n                <i class=\"fa fa-warning\"></i>&nbsp;Beware when using routers. It seems that the header and footer stay\n                in your DOM even when you change your application state. So you will need to tweak your code to remove them\n                when exiting the state. Here some examples:\n            </p>\n            <br />\n            <p>\n                <button class=\"btn btn-danger\" ng-click=\"showNgRouterExample = !showNgRouterExample;showOtherRouterExample=false\">\n                    If you are using Angular ui-router\n                </button>\n                <button class=\"btn btn-danger\" ng-click=\"showOtherRouterExample = !showOtherRouterExample;showNgRouterExample=false\">Other routers</button>\n            </p>\n            <br />\n            <div collapse=\"!showNgRouterExample\">\n                <p>\n                    If you are using <a href=\"https://github.com/angular-ui/ui-router\">Angular ui-router</a>, you can\n                    add an <code>onExit</code> callback like this:\n                </p>\n<div hljs>\n$stateProvider.state(\"contacts\", {\n    templateUrl: \'somewhereInDaSpace\',\n    controller: function($scope, title){\n        // Do your stuff\n    },\n    onEnter: function(title){\n        // Do your stuff\n    },\n    onExit: function(){\n        // Remove the DataTables FixedHeader plugin\'s headers and footers\n        var fixedHeaderEle = document.getElementsByClassName(\'fixedHeader\');\n        angular.element(fixedHeaderEle).remove();\n        var fixedFooterEle = document.getElementsByClassName(\'fixedFooter\');\n        angular.element(fixedFooterEle).remove();\n    }\n});\n</div>\n            </div>\n            <div collapse=\"!showOtherRouterExample\">\n<div hljs>\n$scope.$on(\'$routeChangeStart\', function(event, next, current) {\n    var fixedHeaderEle = document.getElementsByClassName(\'fixedHeader\');\n    angular.element(fixedHeaderEle).remove();\n    var fixedFooterEle = document.getElementsByClassName(\'fixedFooter\');\n    angular.element(fixedFooterEle).remove();\n});\n</div>\n            </div>\n        </div>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"https://cdn.datatables.net/fixedheader/3.1.2/css/fixedHeader.dataTables.min.css\">\n<!-- ... -->\n<div ng-controller=\"WithFixedHeaderCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\">\n        <tfoot>\n        <tr>\n            <th>ID</th>\n            <th>First name</th>\n            <th>Last name</th>\n        </tr>\n        </tfoot>\n    </table>\n</div>\n<!-- ... -->\n<script src=\"https://cdn.datatables.net/fixedheader/3.1.2/js/dataTables.fixedHeader.min.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/fixedheader/angular-datatables.fixedheader.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withFixedHeader\', [\'datatables\', \'datatables.fixedheader\'])\n.controller(\'WithFixedHeaderCtrl\', WithFixedHeaderCtrl);\n\nfunction WithFixedHeaderCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        .withDisplayLength(25)\n        .withFixedHeader({\n            bottom: true\n        });\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n        <div ng-controller=\"WithFixedHeaderCtrl as showCase\">\n            <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\">\n                <tfoot>\n                <tr>\n                    <th>ID</th>\n                    <th>First name</th>\n                    <th>Last name</th>\n                </tr>\n                </tfoot>\n            </table>\n        </div>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withLightColumnFilter.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the <a href=\"https://github.com/thansen-solire/datatables-light-columnfilter\"> DataTables Light Column Filter</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>Light Column Filter</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.light-columnfilter.min.js</code> to your HTML file.\n        </p>\n        <p class=\"alert alert-warning\">\n            <i class=\"fa fa-warning\"></i> The Light Column Filter only works with serverside processing! <br>\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.light-columnfilter</code> to your Angular app.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithLightColumnFilterCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\">\n                            <tfoot>\n                            <tr>\n                                <th>ID\n                                <th>First Name\n                                <th>Last Name\n                            </tr>\n                            </tfoot>\n                        </table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"WithLightColumnFilterCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\">\n        <tfoot>\n        <tr>\n            <th>ID\n            <th>First Name\n            <th>Last Name\n        </tr>\n        </tfoot>\n    </table>\n</div>\n<!-- ... -->\n<script src=\"vendor/datatables-light-columnfilter/dist/dataTables.lightColumnFilter.min.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/light-columnfilter/angular-datatables.light-columnfilter.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withLightColumnFilter\', [\'datatables\', \'datatables.light-columnfilter\'])\n.controller(\'WithLightColumnFilterCtrl\', WithLightColumnFilterCtrl);\n\nfunction WithColumnFilterCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        .withLightColumnFilter({\n            \'0\' : {\n                type : \'text\'\n            },\n            \'1\' : {\n                type : \'text\'\n            },\n            \'2\' : {\n                type : \'select\',\n                values: [{\n                    value: \'Yoda\', label: \'Yoda foobar\'\n                }, {\n                    value: \'Titi\', label: \'Titi foobar\'\n                }, {\n                    value: \'Kyle\', label: \'Kyle foobar\'\n                }, {\n                    value: \'Bar\', label: \'Bar foobar\'\n                }, {\n                    value: \'Whateveryournameis\', label: \'Whateveryournameis foobar\'\n                }]\n            }\n        });\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withResponsive.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/responsive/\">Responsive</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            You can easily add the DataTables <code>Responsive</code> plugin. Include the <a href=\"//cdn.datatables.net/responsive/1.0.1/js/dataTables.responsive.js\">JS file</a> and\n            <a href=\"//cdn.datatables.net/responsive/1.0.1/css/dataTables.responsive.css\">CSS file</a>. Then set the <code>responsivce</code> option to <code>true</code>.\n        </p>\n        <p class=\"alert alert-warning\">\n            <i class=\"fa fa-warning\"></i>&nbsp;The API <code>DTColumn.notVisible()</code> does not work in this case. Use <code>DTColumn.withClass(\'none\')</code> instead.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithResponsiveCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\" width=\"100%\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"https://cdn.datatables.net/responsive/2.1.0/css/responsive.dataTables.min.css\">\n<!-- ... -->\n<div ng-controller=\"WithResponsiveCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\" width=\"100%\"></table>\n</div>\n<!-- ... -->\n<script src=\"https://cdn.datatables.net/responsive/2.1.0/js/dataTables.responsive.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withResponsive\', [\'datatables\'])\n.controller(\'WithResponsiveCtrl\', WithResponsiveCtrl);\n\nfunction WithResponsiveCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        // Active Responsive plugin\n        .withOption(\'responsive\', true);\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        // .notVisible() does not work in this case. Use .withClass(\'none\') instead\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\').withClass(\'none\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withScroller.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"http://datatables.net/extensions/scroller/\">Scroller</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>Scroller</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.scroller.min.js</code> to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.scroller</code> to your Angular app.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithScrollerCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"https://cdn.datatables.net/scroller/1.4.2/css/scroller.dataTables.min.css\">\n<!-- ... -->\n<div ng-controller=\"WithScrollerCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n</div>\n<!-- ... -->\n<script src=\"https://cdn.datatables.net/scroller/1.4.2/js/dataTables.scroller.min.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/scroller/angular-datatables.scroller.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withScroller\', [\'datatables\', \'datatables.scroller\'])\n.controller(\'WithScrollerCtrl\', WithScrollerCtrl);\n\nfunction WithScrollerCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withDOM(\'lfrti\')\n        .withScroller()\n        .withOption(\'deferRender\', true)\n        // Do not forget to add the scorllY option!!!\n        .withOption(\'scrollY\', 200);\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withSelect.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1>\n            <i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/select/\">Select</a>\n        </h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>Select</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.select.min.js</code> to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.select</code> to your Angular app.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithSelectCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"https://cdn.datatables.net/select/1.2.0/css/select.dataTables.min.css\">\n<!-- ... -->\n<div ng-controller=\"WithSelectCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n</div>\n<!-- ... -->\n<script src=\"https://cdn.datatables.net/select/1.2.0/js/dataTables.select.min.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/select/angular-datatables.select.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withSelect\', [\'datatables\', \'datatables.select\'])\n    .controller(\'WithSelectCtrl\', WithSelectCtrl);\n\nfunction WithSelectCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        // Active Select plugin\n        .withSelect({\n            style:    \'os\',\n            selector: \'td:first-child\'\n        });\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(null).withTitle(\'\')\n            .notSortable()\n            .withClass(\'select-checkbox\')\n            // Need to define the mRender function, otherwise we get a [Object Object]\n            .renderWith(function() {return \'\';}),\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/demo/withPlugins/withTableTools.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1>\n            <i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/tabletools/\">TableTools</a>\n            <b>[deprecated]</b>\n        </h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>TableTools</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.tabletools.min.js</code> to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.tabletools</code> to your Angular app.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n        <p class=\"alert alert-danger\">\n            <i class=\"fa fa-warning\"></i>&nbsp;This extension has been retired and has been replaced by the\n            <a href=\"https://datatables.net/extensions/select/\">Select extension</a> and the <a href=\"https://datatables.net/extensions/buttons/\">Button extension</a>.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithTableToolsCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"vendor/datatables-tabletools/css/dataTables.tableTools.css\">\n<!-- ... -->\n<div ng-controller=\"WithTableToolsCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\"></table>\n</div>\n<!-- ... -->\n<script src=\"vendor/datatables-tabletools/js/dataTables.tableTools.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/tabletools/angular-datatables.tabletools.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withTableTools\', [\'datatables\', \'datatables.tabletools\'])\n.controller(\'WithTableToolsCtrl\', WithTableToolsCtrl);\n\nfunction WithTableToolsCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder\n        .fromSource(\'data.json\')\n        // Add Table tools compatibility\n        .withTableTools(\'vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\')\n        .withTableToolsButtons([\n            \'copy\',\n            \'print\', {\n                \'sExtends\': \'collection\',\n                \'sButtonText\': \'Save\',\n                \'aButtons\': [\'csv\', \'xls\', \'pdf\']\n            }\n        ]);\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\').withClass(\'text-danger\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/advanced/angularWayDataChange.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Changing data with the Angular way</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            It\'s quite simple. You just need to do it like usual, ie you just need to deal with your array of data.\n        </p>\n        <p class=\"text-info\">\n            <i class=\"fa fa-info-circle\"></i>&nbsp;However, take in mind that when updating the array of data,\n            the whole DataTable is completely destroyed and then rebuilt. The filter, sort, pagination, and so on... are\n            not preserved.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"angularWayChangeDataCtrl\">\n                        <form class=\"form-inline\" ng-submit=\"addPerson()\">\n                            <table datatable=\"ng\" dt-options=\"dtOptions\" dt-column-defs=\"dtColumnDefs\" class=\"row-border hover\">\n                                <thead>\n                                <tr>\n                                    <th>\n                                        <div class=\"form-group\">\n                                            <label>\n                                                <input class=\"form-control\" type=\"number\" name=\"id\" ng-model=\"person2Add.id\" value=\"\"/>\n                                            </label>\n                                        </div>\n                                    </th>\n                                    <th>\n                                        <div class=\"form-group\">\n                                            <label>\n                                                <input type=\"text\" class=\"form-control\" name=\"firstName\" ng-model=\"person2Add.firstName\" value=\"\"/>\n                                            </label>\n                                        </div>\n                                    </th>\n                                    <th>\n                                        <div class=\"form-group\">\n                                            <label>\n                                                <input type=\"text\" class=\"form-control\" name=\"lastName\" ng-model=\"person2Add.lastName\" value=\"\"/>\n                                            </label>\n                                        </div>\n                                    </th>\n                                    <th>\n                                        <div class=\"form-group\">\n                                            <button type=\"submit\" class=\"btn btn-success\"><i class=\"fa fa-plus\"></i></button>\n                                        </div>\n                                    </th>\n                                </tr>\n                                <tr>\n                                    <th>ID</th>\n                                    <th>FirstName</th>\n                                    <th>LastName</th>\n                                    <th></th>\n                                </tr>\n                                </thead>\n                                <tbody>\n                                <tr ng-repeat=\"person in persons\">\n                                    <td>{{ person.id }}</td>\n                                    <td>{{ person.firstName }}</td>\n                                    <td>{{ person.lastName }}</td>\n                                    <td>\n                                        <button type=\"button\" ng-click=\"modifyPerson($index)\" class=\"btn btn-warning\"><i class=\"fa fa-edit\"></i></button>\n                                        <button type=\"button\" ng-click=\"removePerson($index)\" class=\"btn btn-danger\"><i class=\"fa fa-trash-o\"></i></button>\n                                    </td>\n                                </tr>\n                                </tbody>\n                            </table>\n                        </form>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"angularWayChangeDataCtrl\">\n    <form class=\"form-inline\" ng-submit=\"addPerson()\">\n        <table datatable=\"ng\" dt-options=\"dtOptions\" dt-column-defs=\"dtColumnDefs\" class=\"row-border hover\">\n            <thead>\n            <tr>\n                <th>\n                    <div class=\"form-group\">\n                        <label>\n                            <input autofocus class=\"form-control\" type=\"number\" name=\"id\" ng-model=\"person2Add.id\" value=\"\"/>\n                        </label>\n                    </div>\n                </th>\n                <th>\n                    <div class=\"form-group\">\n                        <label>\n                            <input type=\"text\" class=\"form-control\" name=\"firstName\" ng-model=\"person2Add.firstName\" value=\"\"/>\n                        </label>\n                    </div>\n                </th>\n                <th>\n                    <div class=\"form-group\">\n                        <label>\n                            <input type=\"text\" class=\"form-control\" name=\"lastName\" ng-model=\"person2Add.lastName\" value=\"\"/>\n                        </label>\n                    </div>\n                </th>\n                <th>\n                    <div class=\"form-group\">\n                        <button type=\"submit\" class=\"btn btn-success\"><i class=\"fa fa-plus\"></i></button>\n                    </div>\n                </th>\n            </tr>\n            <tr>\n                <th>ID</th>\n                <th>FirstName</th>\n                <th>LastName</th>\n                <th></th>\n            </tr>\n            </thead>\n            <tbody>\n            <tr ng-repeat=\"person in persons\">\n                <td>{{ person.id }}</td>\n                <td>{{ person.firstName }}</td>\n                <td>{{ person.lastName }}</td>\n                <td>\n                    <button type=\"button\" ng-click=\"modifyPerson($index)\" class=\"btn btn-warning\"><i class=\"fa fa-edit\"></i></button>\n                    <button type=\"button\" ng-click=\"removePerson($index)\" class=\"btn btn-danger\"><i class=\"fa fa-trash-o\"></i></button>\n                </td>\n            </tr>\n            </tbody>\n        </table>\n    </form>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'ngResource\', \'datatables\']).\ncontroller(\'angularWayChangeDataCtrl\', function ($scope, $resource, DTOptionsBuilder, DTColumnDefBuilder) {\n    var _buildPerson2Add = function (id) {\n        return {\n            id: id,\n            firstName: \'Foo\' + id,\n            lastName: \'Bar\' + id\n        }\n    };\n\n    $scope.persons = $resource(\'data1.json\').query();\n    $scope.dtOptions = DTOptionsBuilder.newOptions().withPaginationType(\'full_numbers\');\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0),\n        DTColumnDefBuilder.newColumnDef(1),\n        DTColumnDefBuilder.newColumnDef(2),\n        DTColumnDefBuilder.newColumnDef(3).notSortable()\n    ];\n\n    $scope.person2Add = _buildPerson2Add(1);\n    $scope.addPerson = function () {\n        $scope.persons.push(angular.copy($scope.person2Add));\n        $scope.person2Add = _buildPerson2Add($scope.person2Add.id + 1);\n    };\n\n    $scope.modifyPerson = function (index) {\n        $scope.persons.splice(index, 1, angular.copy($scope.person2Add))\n        $scope.person2Add = _buildPerson2Add($scope.person2Add.id + 1);\n    };\n\n    $scope.removePerson = function (index) {\n        $scope.persons.splice(index, 1);\n    };\n});\n</div>\n            </tab>\n            <tab heading=\"Example data\">\n                <p class=\"example-data\">\n                    <a target=\"_blank\" href=\"/angular-datatables/data1.json\" tooltip=\"data1.json\">data1.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                </p>\n<div hljs language=\"json\">\n[{\n    \"id\": 860,\n    \"firstName\": \"Superman\",\n    \"lastName\": \"Yoda\"\n}, {\n    \"id\": 870,\n    \"firstName\": \"Foo\",\n    \"lastName\": \"Whateveryournameis\"\n}, {\n    \"id\": 590,\n    \"firstName\": \"Toto\",\n    \"lastName\": \"Titi\"\n}, {\n    \"id\": 803,\n    \"firstName\": \"Luke\",\n    \"lastName\": \"Kyle\"\n},\n...\n]\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/advanced/bindAngularDirective.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Binding Angular directive to the DataTable</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            If you are not using the <a ui-sref=\"angularWay\">Angular way</a> of rendering your DataTable, but you want to be able to add Angular directives in your DataTable, you can do it by recompiling your DataTable after its initialization is over.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"bindAngularDirectiveCtrl\">\n                        <p class=\"text-danger\"><strong>{{ message }}</strong></p>\n                        <br />\n                        <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"bindAngularDirectiveCtrl\">\n    <p class=\"text-danger\"><strong>{{ message }}</strong></p>\n    <br />\n    <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\').\ncontroller(\'bindAngularDirectiveCtrl\', function ($scope, $compile, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.message = \'\';\n    $scope.edit = function(id) {\n        $scope.message = \'You are trying to edit the row with ID: \' + id;\n        // Edit some data and call server to make changes...\n        // Then reload the data so that DT is refreshed\n        $scope.dtOptions.reloadData();\n    };\n    $scope.delete = function(id) {\n        $scope.message = \'You are trying to remove the row with ID: \' + id;\n        // Delete some data and call server to make changes...\n        // Then reload the data so that DT is refreshed\n        $scope.dtOptions.reloadData();\n    };\n\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data1.json\')\n        .withPaginationType(\'full_numbers\')\n        .withOption(\'createdRow\', function(row, data, dataIndex) {\n            // Recompiling so we can bind Angular directive to the DT\n            $compile(angular.element(row).contents())($scope);\n        });\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\'),\n        DTColumnBuilder.newColumn(null).withTitle(\'Actions\').notSortable()\n            .renderWith(function(data, type, full, meta) {\n                return \'<button class=\"btn btn-warning\" ng-click=\"edit(\' + data.id + \')\">\' +\n                    \'   <i class=\"fa fa-edit\"></i>\' +\n                    \'</button>&nbsp;\' +\n                    \'<button class=\"btn btn-danger\" ng-click=\"delete(\' + data.id + \')\">\' +\n                    \'   <i class=\"fa fa-trash-o\"></i>\' +\n                    \'</button>\';\n            })\n    ];\n});\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/advanced/changeOptions.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Change DataTable <a href=\"http://www.datatables.net/reference/option/\">options</a>/<a href=\"http://datatables.net/reference/option/columns\">columns</a>/<a href=\"http://datatables.net/reference/option/columnDefs\">columnDef</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            You can change the DataTable options, columns or columnDefs seamlessly. All you need to do is to change the <code>dtOptions</code>, <code>dtColumns</code> or <code>dtColumnDefs</code> of your DataTable.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"changeOptionsCtrl\">\n                        <p>\n                            <button type=\"button\" class=\"btn btn-primary\" ng-click=\"changeOptions()\">Change options</button>\n                            <button type=\"button\" class=\"btn btn-primary\" ng-click=\"changeColumnDefs()\">Change column defs</button>\n                        </p>\n                        <table datatable dt-options=\"dtOptions\" dt-column-defs=\"dtColumnDefs\" class=\"row-border hover\">\n                            <thead>\n                            <tr>\n                                <th>ID</th>\n                                <th>First name</th>\n                                <th>Last name</th>\n                            </tr>\n                            </thead>\n                            <tbody>\n                            <tr>\n                                <td>1</td>\n                                <td>Foo</td>\n                                <td>Bar</td>\n                            </tr>\n                            <tr>\n                                <td>123</td>\n                                <td>Someone</td>\n                                <td>Youknow</td>\n                            </tr>\n                            <tr>\n                                <td>987</td>\n                                <td>Iamout</td>\n                                <td>Ofinspiration</td>\n                            </tr>\n                            </tbody>\n                        </table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"changeOptionsCtrl\">\n    <p>\n        <button type=\"button\" class=\"btn btn-primary\" ng-click=\"changeOptions()\">Change options</button>\n        <button type=\"button\" class=\"btn btn-primary\" ng-click=\"changeColumnDefs()\">Change column defs</button>\n    </p>\n    <table datatable dt-options=\"dtOptions\" dt-column-defs=\"dtColumnDefs\" class=\"row-border hover\">\n        <thead>\n        <tr>\n            <th>ID</th>\n            <th>First name</th>\n            <th>Last name</th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr>\n            <td>1</td>\n            <td>Foo</td>\n            <td>Bar</td>\n        </tr>\n        <tr>\n            <td>123</td>\n            <td>Someone</td>\n            <td>Youknow</td>\n        </tr>\n        <tr>\n            <td>987</td>\n            <td>Iamout</td>\n            <td>Ofinspiration</td>\n        </tr>\n        </tbody>\n    </table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\']).\ncontroller(\'withOptionsCtrl\', function ($scope, DTOptionsBuilder, DTColumnDefBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.newOptions();\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0),\n        DTColumnDefBuilder.newColumnDef(1).notVisible(),\n        DTColumnDefBuilder.newColumnDef(2).notSortable()\n    ];\n\n    $scope.changeOptions = function() {\n        $scope.dtOptions = DTOptionsBuilder.newOptions()\n            .withPaginationType(\'full_numbers\')\n            .withDisplayLength(2)\n            .withDOM(\'pitrfl\');\n    };\n    $scope.changeColumnDefs = function() {\n        $scope.dtColumnDefs = [\n            DTColumnDefBuilder.newColumnDef(0).notVisible(),\n            DTColumnDefBuilder.newColumnDef(1).notVisible(),\n            DTColumnDefBuilder.newColumnDef(2).notSortable()\n        ];\n    };\n});\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/advanced/dataReloadWithAjax.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Load/Reload the table data from an Ajax source</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            This module also handles data reloading / loading from an Ajax source:\n        </p>\n        <ul>\n            <li>\n                If you need to load data, you just have to override the <code>dtOptions.sAjaxSource</code> property.\n            </li>\n            <li>\n                If you need to reload the data, you just have to call the function <code>dtOptions.reloadData();</code>.\n            </li>\n        </ul>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"dataReloadWithAjaxCtrl\">\n                        <p>\n                            <button ng-click=\"reloadData()\" type=\"button\" class=\"btn btn-info\">\n                                <i class=\"fa fa-refresh\"></i>&nbsp;Reload data\n                            </button>\n                            <button ng-click=\"changeData()\" type=\"button\" class=\"btn btn-info\">\n                                <i class=\"fa fa-exchange\"></i>&nbsp;Change data\n                            </button>\n                        </p>\n                        <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs language=\"html\">\n<div ng-controller=\"dataReloadWithAjaxCtrl\">\n    <p>\n        <button ng-click=\"reloadData()\" type=\"button\" class=\"btn btn-info\">\n            <i class=\"fa fa-refresh\"></i>&nbsp;Reload data\n        </button>\n        <button ng-click=\"changeData()\" type=\"button\" class=\"btn btn-info\">\n            <i class=\"fa fa-exchange\"></i>&nbsp;Change data\n        </button>\n    </p>\n    <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\'])\n.controller(\'dataReloadWithAjaxCtrl\', function($scope, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.reloadData = function() {\n        $scope.dtOptions.reloadData();\n    };\n    $scope.changeData = function() {\n        $scope.dtOptions.sAjaxSource = \'data1.json\';\n    };\n\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\').withPaginationType(\'full_numbers\');\n\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\').notVisible()\n    ];\n});\n</div>\n            </tab>\n            <tab heading=\"Example data\">\n                <p class=\"example-data\">\n                    <a target=\"_blank\" href=\"/angular-datatables/data.json\" tooltip=\"data.json\">data.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                    <br />\n                    <a target=\"_blank\" href=\"/angular-datatables/data1.json\" tooltip=\"data1.json\">data1.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                </p>\n<div hljs language=\"json\">\n[{\n    \"id\": 860,\n    \"firstName\": \"Superman\",\n    \"lastName\": \"Yoda\"\n}, {\n    \"id\": 870,\n    \"firstName\": \"Foo\",\n    \"lastName\": \"Whateveryournameis\"\n}, {\n    \"id\": 590,\n    \"firstName\": \"Toto\",\n    \"lastName\": \"Titi\"\n}, {\n    \"id\": 803,\n    \"firstName\": \"Luke\",\n    \"lastName\": \"Kyle\"\n},\n...\n]\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/advanced/dataReloadWithPromise.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Load/Reload the table data from a promise function</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            In some case, you need to load some new data. This module handles data loading seamlessly.\n        </p>\n        <ul>\n            <li>\n                If you need to load new data, you just need to override the <code>dtOptions.fnPromise</code> with a new function that returns a promise or a promise.\n            </li>\n            <li>\n                If you need to reload the data, you just have to call the function <code>dtOptions.reloadData();</code>.\n            </li>\n        </ul>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"dataReloadWithPromiseCtrl\">\n                        <p>\n                            <button ng-click=\"reloadData()\" type=\"button\" class=\"btn btn-info\">\n                                <i class=\"fa fa-refresh\"></i>&nbsp;Reload data\n                            </button>\n                            <button ng-click=\"changeData()\" type=\"button\" class=\"btn btn-info\">\n                                <i class=\"fa fa-exchange\"></i>&nbsp;Change data\n                            </button>\n                        </p>\n                        <table datatable=\"\" dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs language=\"html\">\n<div ng-controller=\"dataReloadWithPromiseCtrl\">\n    <p>\n        <button ng-click=\"reloadData()\" type=\"button\" class=\"btn btn-info\">\n            <i class=\"fa fa-refresh\"></i>&nbsp;Reload data\n        </button>\n        <button ng-click=\"changeData()\" type=\"button\" class=\"btn btn-info\">\n            <i class=\"fa fa-exchange\"></i>&nbsp;Change data\n        </button>\n    </p>\n    <table datatable=\"\" dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'ngResource\', \'datatables\'])\n.controller(\'dataReloadWithPromiseCtrl\', function($scope, DTOptionsBuilder, DTColumnBuilder, $resource) {\n    $scope.reloadData = function() {\n        $scope.dtOptions.reloadData();\n    };\n    $scope.changeData = function() {\n        $scope.dtOptions.fnPromise = function() {\n            return $resource(\'data1.json\').query().$promise;\n        };\n        // Or $scope.dtOptions.fnPromise = $resource(\'data1.json\').query().$promise;\n    };\n\n    $scope.dtOptions = DTOptionsBuilder.fromFnPromise(function() {\n            return $resource(\'data.json\').query().$promise;\n        }).withPaginationType(\'full_numbers\');\n\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\').notVisible()\n    ];\n});\n</div>\n            </tab>\n            <tab heading=\"Example data\">\n                <p class=\"example-data\">\n                    <a target=\"_blank\" href=\"/angular-datatables/data.json\" tooltip=\"data.json\">data.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                    <br />\n                    <a target=\"_blank\" href=\"/angular-datatables/data1.json\" tooltip=\"data1.json\">data1.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                </p>\n<div hljs language=\"json\">\n[{\n    \"id\": 860,\n    \"firstName\": \"Superman\",\n    \"lastName\": \"Yoda\"\n}, {\n    \"id\": 870,\n    \"firstName\": \"Foo\",\n    \"lastName\": \"Whateveryournameis\"\n}, {\n    \"id\": 590,\n    \"firstName\": \"Toto\",\n    \"lastName\": \"Titi\"\n}, {\n    \"id\": 803,\n    \"firstName\": \"Luke\",\n    \"lastName\": \"Kyle\"\n},\n...\n]\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/advanced/rowClickEvent.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Row click event</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            Simple example to bind a click event on each row of the DataTable with the help of <a href=\"http://datatables.net/reference/option/rowCallback\">rowCallback</a>.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"rowClickEventCtrl\">\n                        <blockquote>Please click on a row</blockquote>\n                        <p class=\"text-danger\">You clicked on: <strong>{{ message }}</strong></p>\n                        <br />\n                        <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"rowClickEventCtrl\">\n    <blockquote>Please click on a row</blockquote>\n    <p class=\"text-danger\">You clicked on: <strong>{{ message }}</strong></p>\n    <br />\n    <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\').\ncontroller(\'rowClickEventCtrl\', function ($scope, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.message = \'\';\n    $scope.someClickHandler = function(info) {\n        $scope.message = info.id + \' - \' + info.firstName;\n    };\n\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        .withOption(\'rowCallback\', function(nRow, aData, iDisplayIndex, iDisplayIndexFull) {\n            // Unbind first in order to avoid any duplicate handler (see https://github.com/l-lin/angular-datatables/issues/87)\n            $(\'td\', nRow).unbind(\'click\');\n            $(\'td\', nRow).bind(\'click\', function() {\n                $scope.$apply(function() {\n                    $scope.someClickHandler(aData);\n                });\n            });\n            return nRow;\n        });\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\').notVisible()\n    ];\n});\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/advanced/serverSideProcessing.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Server side processing</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            From DataTables documentation:\n        </p>\n        <blockquote>\n            <p>\n                There are times when reading data from the DOM is simply too slow or unwieldy, particularly when dealing with many thousands or millions of data rows.\n                To address this DataTables\' server-side processing feature provides a method to let all the \"heavy lifting\" be done by a database engine on the server-side\n                (they are after all highly optimised for exactly this use case!), and then have that information drawn in the user\'s web-browser. Consequently,\n                you can display tables consisting of millions of rows with ease.\n            </p>\n            <p>\n                When using server-side processing, DataTables will make an Ajax request to the server for each draw of the information on the page\n                (i.e. when paging, ordering, searching, etc.). DataTables will send a number of variables to the server to allow it to perform the\n                required processing and then return the data in the format required by DataTables.\n            </p>\n            <p>\n                Server-side processing is enabled by use of the serverSideDT option, and configured using ajaxDT.\n            </p>\n        </blockquote>\n        <p>\n            For more information, please check out <a href=\"https://datatables.net/manual/server-side\">DataTable\'s documentation</a>.\n        </p>\n        <div class=\"alert alert-info\">\n            <p>\n                <b><i class=\"fa fa-warning\"></i>&nbsp;Note</b>\n            </p>\n            <ul>\n                <li>\n                    This feature is only available with Ajax rendering!\n                </li>\n                <li>\n                    By default, <code>angular-datatables</code> set the <a href=\"http://datatables.net/reference/option/ajax.dataSrc\"><code>AjaxDataProp</code></a> to <code>\'\'</code>. So you need to provide the <code>AjaxDataProp</code> with either <code>.withDataProp(\'data\')</code> or specifying the option <code>dataSrc</code> in the <code>ajax</code> option.\n                </li>\n            </ul>\n        </div>\n        <p class=\"text-warning\">\n            <i class=\"fa fa-info-circle\"></i>&nbsp;With your browser debugger, you might notice that this example does not use the server side processing.\n            Indeed, since Github pages are static HTML files, there are no real server to show you a real case study.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"serverSideProcessingCtrl\">\n                        <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"serverSideProcessingCtrl\">\n    <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\'])\n.controller(\'serverSideProcessingCtrl\', function ($scope, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.newOptions()\n        .withOption(\'ajax\', {\n            // Either you specify the AjaxDataProp here\n            // dataSrc: \'data\',\n            url: \'data/serverSideProcessing\',\n            type: \'POST\'\n        })\n        // or here\n        .withDataProp(\'data\')\n        .withOption(\'serverSide\', true)\n        .withPaginationType(\'full_numbers\');\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\').notVisible()\n    ];\n});\n</div>\n            </tab>\n            <tab heading=\"Example data\">\n<div hljs language=\"json\">\n{\n    \"draw\": 1,\n    \"recordsTotal\": 57,\n    \"recordsFiltered\": 57,\n    \"data\": [\n        {\n            \"DT_RowId\": \"row_3\",\n            \"DT_RowData\": {\n                \"pkey\": 3\n            },\n            \"id\": 860,\n            \"firstName\": \"Superman\",\n            \"lastName\": \"Yoda\"\n        {\n            \"DT_RowId\": \"row_17\",\n            \"DT_RowData\": {\n                \"pkey\": 17\n            },\n            \"id\": 870,\n            \"firstName\": \"Foo\",\n            \"lastName\": \"Whateveryournameis\"\n        },\n        ...\n    ]\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/api/api.html","<article class=\"main-content api\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-code\"></i>&nbsp;API</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The Angular DataTables module has several helpers that helps you build DataTables options.\n        </p>\n    </section>\n    <section ng-controller=\"apiCtrl\" class=\"showcase\">\n        <tabset>\n            <tab heading=\"DTDefaultOptions\">\n                <article ng-include=\"\'demo/api/apiDefaultOptions.html\'\"></article>\n            </tab>\n            <tab heading=\"DTOptionsBuilder\">\n                <article ng-include=\"\'demo/api/apiOptionsBuilder.html\'\"></article>\n            </tab>\n            <tab heading=\"DTColumnBuilder\">\n                <article ng-include=\"\'demo/api/apiColumnBuilder.html\'\"></article>\n            </tab>\n            <tab heading=\"DTColumnDefBuilder\">\n                <article ng-include=\"\'demo/api/apiColumnDefBuilder.html\'\"></article>\n            </tab>\n        </tabset>\n    </section>\n\n    <section class=\"showcase\"></section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/api/apiColumnBuilder.html","<h3><code>DTColumnBuilder</code></h3>\n    <p>\n        This service will help you build your datatables column options. All it\'s doing is appending to the DataTables options the object <code>aoColumns</code>\n    </p>\n    <p>For instance, the following:</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.newOptions();\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'fooData\', \'FooTitle\')\n    ];\n});\n</div>\n    <p>\n        is the same as writing:\n    </p>\n<div hljs language=\"js\">\n    $scope.options = {\n        \'aoColumns\': [{\n            \'mData\': \'fooData\',\n            \'sTitle\': \'FooTitle\'\n        }]\n    };\n</div>\n    <p>\n        <strong>Note</strong>: Of course, this helper is not mandatory. This helper only constructs a JSON object.\n        You can directly pass the datatable column options on the element attributes and <code>dt-columns</code>.\n    </p>\n    <p class=\"text-danger\">\n        <i class=\"fa fa-warning\"></i>&nbsp;The column defs must be provided in the <code>dt-column-defs</code> directive whereas the column options must be provided in\n        the <code>dt-columns\"</code> directive.\n    </p>\n<div hljs language=\"html\">\n<table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" dt-column-defs=\"dtColumnDefs\"></table>\n</div>\n    <br />\n    <table datatable dt-options=\"dtOptions\" class=\"row-border hover\">\n        <thead>\n        <tr>\n            <th>Helper/Wrapper</th>\n            <th>API</th>\n            <th>Description</th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr>\n            <td><code>DTColumnBuilder</code></td>\n            <td><code>newColumn(mData, label)</code></td>\n            <td>\n                <p>Create a new wrapped <code>DTColumn</code>.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnBuilder) {\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'foo\', \'Foo\')\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumn</code></td>\n            <td><code>withOption(key, value)</code></td>\n            <td>\n                Add the option of the column. For example, the following code add the option <code>sContentPadding</code>:\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnBuilder) {\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'foo\').withOption(\'sContentPadding\', \'mmm\')\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumn</code></td>\n            <td><code>withTitle(title)</code></td>\n            <td>\n                <p>Set the title of the colum.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnBuilder) {\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'foo\').withTitle(\'FooTitle\')\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumn</code></td>\n            <td><code>withClass(sClass)</code></td>\n            <td>\n                <p>Set the CSS class of the column</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnBuilder) {\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'foo\').withClass(\'foo-class\')\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumn</code></td>\n            <td><code>notVisible()</code></td>\n            <td>\n                <p>Hide the column.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnBuilder) {\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'foo\').notVisible()\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumn</code></td>\n            <td><code>notSortable()</code></td>\n            <td>\n                <p>Set the column as not sortable</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnBuilder) {\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'foo\').notSortable()\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumn</code></td>\n            <td><code>renderWith(mrender)</code></td>\n            <td>\n                Render each cell with the given parameter\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnBuilder) {\n    // Data fetched: {gender: \'Mr\', firstName: \'foo\', lastName: \'bar\'}\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'firstName\').withLabel(\'First name\').renderWith(function(data, type, full) {\n            return full.gender + \' \' + full.firstName;\n        });\n    ];\n});\n</div>\n            </td>\n        </tr>\n        </tbody>\n    </table>");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/api/apiColumnDefBuilder.html","<h3><code>DTColumnDefBuilder</code></h3>\n    <p>\n        This service will help you build your datatables column defs. All it\'s doing is appending to the DataTables options the object <code>aoColumnDefs</code>\n    </p>\n    <p>\n        Writing the following code:\n    </p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTOptionsBuilder, DTColumnDefBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.newOptions();\n    $scope.DTColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0).notSortable()\n    ];\n});\n</div>\n    <p>\n        is the same as writing the following:\n    </p>\n<div hljs language=\"js\">\n$scope.options = {\n    aoColumnDefs: [\n        {\n            aTargets: 0,\n            bSortable: false\n        }\n    ]\n};\n</div>\n    <p>\n        <strong>Note</strong>: Of course, this helper is not mandatory. This helper only constructs a JSON object.\n        You can directly pass the datatable column options on the element attributes and <code>dt-column-defs</code>.\n    </p>\n    <p class=\"text-danger\">\n        <i class=\"fa fa-warning\"></i>&nbsp;The column defs must be provided in the <code>dt-column-defs</code> directive whereas the column options must be provided in\n        the <code>dt-columns\"</code> directive.\n    </p>\n<div hljs language=\"html\">\n<table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumn\" dt-column-defs=\"dtColumnDefs\"></table>\n</div>\n    <br />\n    <table datatable dt-options=\"dtOptions\" class=\"row-border hover\">\n        <thead>\n        <tr>\n            <th>Helper/Wrapper</th>\n            <th>API</th>\n            <th>Description</th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr>\n            <td><code>DTColumnDefBuilder</code></td>\n            <td><code>newColumnDef(aTargets)</code></td>\n            <td>\n                <p>Create a new wrapped <code>DTColumnDef</code>. It posseses the same function as <code>DTColumn</code>.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnDefBuilder) {\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0)\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumnDef</code></td>\n            <td><code>withOption(key, value)</code></td>\n            <td>\n                Add the option of the column. For example, the following code add the option <code>sContentPadding</code>:\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnDefBuilder) {\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0).withOption(\'sContentPadding\', \'mmm\')\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumnDef</code></td>\n            <td><code>withTitle(title)</code></td>\n            <td>\n                <p>Set the title of the colum.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnDefBuilder) {\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0).withTitle(\'FooTitle\')\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumnDef</code></td>\n            <td><code>withClass(sClass)</code></td>\n            <td>\n                <p>Set the CSS class of the column</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnDefBuilder) {\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0).withClass(\'foo-class\')\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumnDef</code></td>\n            <td><code>notVisible()</code></td>\n            <td>\n                <p>Hide the column.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnDefBuilder) {\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0).notVisible()\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumnDef</code></td>\n            <td><code>notSortable()</code></td>\n            <td>\n                <p>Set the column as not sortable</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnDefBuilder) {\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0).notSortable()\n    ];\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTColumnDef</code></td>\n            <td><code>renderWith(mrender)</code></td>\n            <td>\n                Render each cell with the given parameter\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTColumnDefBuilder) {\n    // Data fetched: {gender: \'Mr\', firstName: \'foo\', lastName: \'bar\'}\n    $scope.DTColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0).renderWith(function(data, type, full) {\n            return full.gender + \' \' + full.firstName;\n        });\n    ];\n});\n</div>\n            </td>\n        </tr>\n        </tbody>\n    </table>");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/api/apiDefaultOptions.html","<h3><code>DTDefaultOptions</code></h3>\n<p>\n    You can provide default options to set for all your datatables, such as the language, the number of items to display...\n</p>\n<table datatable dt-options=\"dtOptions\" class=\"row-border hover\">\n    <thead>\n    <tr>\n        <th>Helper/Wrapper</th>\n        <th>API</th>\n        <th>Description</th>\n    </tr>\n    </thead>\n    <tbody>\n    <tr>\n        <td><code>DTDefaultOptions</code></td>\n        <td><code>setLanguageSource(sLanguageSource)</code></td>\n        <td>\n            Set the default language source for all datatables.\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\']).run(function(DTDefaultOptions) {\n    DTDefaultOptions.setLanguageSource(\'/path/to/language\');\n});\n</div>\n        </td>\n    </tr>\n    <tr>\n        <td><code>DTDefaultOptions</code></td>\n        <td><code>setLanguage(oLanguage)</code></td>\n        <td>\n            Set the default language for all datatables.\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\']).run(function(DTDefaultOptions) {\n    DTDefaultOptions.setLanguage({\n        sUrl: \'/path/to/language\'\n    });\n});\n</div>\n        </td>\n    </tr>\n    <tr>\n        <td><code>DTDefaultOptions</code></td>\n        <td><code>setDisplayLength(iDisplayLength)</code></td>\n        <td>\n            Set the default numbers of items to display for all datatables.\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\']).run(function(DTDefaultOptions) {\n    // Display 25 items per page by default\n    DTDefaultOptions.setDisplayLength(25);\n});\n</div>\n        </td>\n    </tr>\n    <tr>\n        <td><code>DTDefaultOptions</code></td>\n        <td><code>setBootstrapOptions(oBootstrapOptions)</code></td>\n        <td>\n            Set the default options for Bootstrap integration.\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\']).run(function(DTDefaultOptions) {\n    // Override the Bootstrap default options\n    DTDefaultOptions.setBootstrapOptions({\n        TableTools: {\n            classes: {\n                container: \'btn-group\',\n                buttons: {\n                    normal: \'btn btn-danger\'\n                }\n            }\n        },\n        ColVis: {\n            classes: {\n                masterButton: \'btn btn-primary\'\n            }\n        }\n    });\n});\n</div>\n        </td>\n    </tr>\n    </tbody>\n</table>");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/api/apiOptionsBuilder.html","<h3><code>DTOptionsBuilder</code></h3>\n    <p>\n        This service will help you build your datatables options.\n    </p>\n    <p class=\"text-info\">\n        <i class=\"fa fa-info-circle\"></i>&nbsp;Keep in mind that those helpers are <strong>NOT</strong> mandatory\n        (<span class=\"text-danger\">except when using promise to fetch the data or using Bootstrap integration</span>).\n        You can also provide the DataTable options directly.\n    </p>\n    <p class=\"text-info\">\n        For instance, the following code:\n    </p>\n<div hljs language=\"js\">\n$scope.dtOptions = DTOptionsBuilder.newOptions().withPaginationType(\'full_numbers\').withDisplayLength(2);\n</div>\n    <p class=\"text-info\">\n        is the same as writing:\n    </p>\n<div hljs language=\"js\">\n$scope.dtOptions = {\n    paginationType: \'full_numbers\',\n    displayLength: 2\n};\n</div>\n<br />\n    <table datatable dt-options=\"dtOptions\" class=\"row-border hover\">\n        <thead>\n        <tr>\n            <th>Helper/Wrapper</th>\n            <th>API</th>\n            <th>Description</th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr>\n            <td><code>DTOptionsBuilder</code></td>\n            <td><code>newOptions()</code></td>\n            <td>\n                <p>Create a wrapped datatables options.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.newOptions();\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptionsBuilder</code></td>\n            <td><code>fromSource(sAjaxSource)</code></td>\n            <td>\n                <p>Create a wrapped datatables options with initialized ajax source.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\');\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptionsBuilder</code></td>\n            <td><code>fromFnPromise(fnPromise)</code></td>\n            <td>\n                <p>Create a wrapped datatables options with a function that returns a promise</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\', \'ngResource\'])\n.controller(\'myCtrl\', function($scope, DTOptionsBuilder, $resource) {\n    $scope.dtOptions = DTOptionsBuilder.fromFnPromise(function() {\n        return $resource(\'data.json\').query().$promise;\n    });\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withOption(key, value)</code></td>\n            <td>\n                <p>\n                    This API is used to add additional option to the DataTables options.\n                </p>\n                <p>\n                    Add an option to the wrapped datatables options. For example, the following code add the option <code>fnRowCallback</code>:\n                </p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.newOptions()\n        .withOption(\'fnRowCallback\',\n            function(nRow, aData, iDisplayIndex, iDisplayIndexFull) {\n                console.log(aData);\n                return nRow;\n            });\n});\n</div>\n                <p>\n                    which is the same as:\n                </p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\']).controller(\'myCtrl\', function($scope) {\n$scope.dtOptions = {\n    \'fnRowCallback\': function(nRow, aData, iDisplayIndex, iDisplayIndexFull) {\n        console.log(aData);\n        return nRow;\n    };\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withSource(sAjaxSource)</code></td>\n            <td>\n                <p>Set the ajax source.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\');\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withDataProp(sAjaxDataProp)</code></td>\n            <td>\n                <p>\n                    Set the Ajax properties. It\'s only compatible with DataTables <span class=\"text-danger\">v1.9.4</span>\n                </p>\n                <blockquote>By default DataTables will look for the property <code>aaData</code>aaData when obtaining data from an Ajax source or for server-side processing -\n                    this parameter allows that property to be changed. You can use Javascript dotted object notation to get a data source for multiple levels of nesting.</blockquote>\n                <p>\n                    See <a href=\"http://legacy.datatables.net/usage/options#sAjaxDataProp\">DataTables documentation</a>.\n                </p>\n<div hljs language=\"js\">\n// Get data from { \"data\": [...] }\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withDataProp(\'data\');\n});\n\n// Get data from { \"data\": { \"inner\": [...] } }\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withDataProp(\'data.inner\');\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withFnServerData(fn)</code></td>\n            <td>\n                <p>\n                    This API allows you to override the default function to retrieve the data (which is <code>$.getJSON</code> according to DataTables documentation)\n                    to something more suitable for you application.\n                </p>\n                <p>\n                    It\'s mainly used for Datatables <span class=\"text-danger\">v1.9.4</span>.\n                    See <a href=\"http://legacy.datatables.net/usage/callbacks#fnServerData\">DataTable documentation</a>.\n                </p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withFnServerData(function (sSource, aoData, fnCallback, oSettings) {\n            oSettings.jqXHR = $.ajax( {\n                \'dataType\': \'json\',\n                \'type\': \'POST\',\n                \'url\': sSource,\n                \'data\': aoData,\n                \'success\': fnCallback\n            });\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withPaginationType(sPaginationType)</code></td>\n            <td>\n                <p>\n                    Set the pagination type of the datatables:\n                </p>\n                <ul>\n                    <li>\n                        <code>two_buttons</code> <span class=\"text-danger\">(only available for v1.9.4)</span>\n                    </li>\n                    <li>\n                        <code>full_numbers</code> - \'First\', \'Previous\', \'Next\' and \'Last\' buttons, plus page numbers\n                    </li>\n                    <li>\n                        <code>full</code> - \'First\', \'Previous\', \'Next\' and \'Last\' buttons <span class=\"text-danger\">(available for v1.10+)</span>\n                    </li>\n                    <li>\n                        <code>simple</code> - \'Previous\' and \'Next\' buttons only <span class=\"text-danger\">(available for v1.10+)</span>\n                    </li>\n                    <li>\n                        <code>simple_numbers</code> - \'Previous\' and \'Next\' buttons, plus page numbers <span class=\"text-danger\">(available for v1.10+)</span>\n                    </li>\n                </ul>\n                <p>\n                    See <a href=\"http://legacy.datatables.net/usage/options#sPaginationType\">DataTables 1.9.4 documentation</a> or\n                    <a href=\"http://datatables.net/examples/basic_init/alt_pagination.html\">DataTables 1.10+ documentation</a>.\n                </p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\');\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withLanguage(oLanguage)</code></td>\n            <td>\n                <p>Set the language of the datatables. If not defined, it uses the default language set by datables, ie english.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withLanguage({\n            sUrl: \'/path/to/language\'\n        });\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withDisplayLength(iDisplayLength)</code></td>\n            <td>\n                <p>Set the number of items per page to display.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withDisplayLength(2);\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withBootstrap()</code></td>\n            <td>\n                <p>Add <a href=\"http://getbootstrap.com\">bootstrap</a> compatibility.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withBootstrap();\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withBootstrapOptions(oBootstrapOptions)</code></td>\n            <td>\n                <p>Override Bootstrap options. It\'s mainly used to override CSS classes used for Bootstrap compatibility.</p>\n                <p>\n                    Angular datatables provides default options. You can check them out on <a href=\"https://github.com/l-lin/angular-datatables/blob/dev/src/angular-datatables.bootstrap.options.js\">Github</a>.\n                </p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withBootstrap()\n        // Overriding the classes\n        .withBootstrapOptions({\n            TableTools: {\n                classes: {\n                    container: \'btn-group\',\n                    buttons: {\n                        normal: \'btn btn-danger\'\n                    }\n                }\n            },\n            ColVis: {\n                classes: {\n                    masterButton: \'btn btn-primary\'\n                }\n            }\n        })\n        // Add ColVis compatibility\n        .withColVis()\n        // Add Table tools compatibility\n        .withTableTools(\'vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\')\n        .withTableToolsButtons([\n                \'copy\',\n                \'print\', {\n                \'sExtends\': \'collection\',\n                \'sButtonText\': \'Save\',\n                \'aButtons\': [\'csv\', \'xls\', \'pdf\']\n            }\n        ]);\n});\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withColReorder()</code></td>\n            <td>\n                <p>Add <a href=\"https://datatables.net/extras/colreorder/\">ColReorder compatibility.</a></p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withColReorder();\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Rlfrtip\"\n}\n</div>\n                <p class=\"text-info\">\n                    <i class=\"fa fa-info-circle\"></i>&nbsp;By calling this API, the letter <code>R</code> is appended to the <a href=\"http://datatables.net/examples/basic_init/dom.html\">DOM positioning</a>.\n                </p>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withColReorderOption(key, value)</code></td>\n            <td>\n                <p>Add option to the attribute <code>oColReorder</code>.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withColReorder()\n        // Fix last right column\n        .withColReorderOption(\'iFixedColumnsRight\', 1);\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Rlfrtip\",\n    \"oColReorder\": {\n        \"iFixedColumnsRight\": 1\n    }\n}\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withColReorderOrder(aiOrder)</code></td>\n            <td>\n                <p>Set the default column order.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withColReorder()\n        // Set order\n        .withColReorderOrder([1, 0, 2]);\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Rlfrtip\",\n    \"oColReorder\": {\n        \"aiOrder\": [1, 0, 2]\n    }\n}\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withColReorderCallback(fnReorderCallback)</code></td>\n            <td>\n                <p>Set the reorder callback function.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withColReorder()\n        .withColReorderCallback(function() {\n            console.log(\'Columns order has been changed with: \' + this.fnOrder());\n        });\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Rlfrtip\",\n    \"oColReorder\": {\n        \"fnReorderCallback\": function() {\n            console.log(\'Columns order has been changed with: \' + this.fnOrder());\n        }\n    }\n}\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withColVis()</code></td>\n            <td>\n                <p>Add <a href=\"https://datatables.net/extras/colvis/\">ColVis</a> compatibility.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withColVis();\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Clfrtip\"\n}\n</div>\n                <p class=\"text-info\">\n                    <i class=\"fa fa-info-circle\"></i>&nbsp;By calling this API, the letter <code>C</code> is appended to the <a href=\"http://datatables.net/examples/basic_init/dom.html\">DOM positioning</a>.\n                </p>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withColVisOption(key, value)</code></td>\n            <td>\n                <p>Add option to the attribute <code>oColVis</code>.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withColVis();\n        // Exclude the column index 2 from the list\n        .withColVisOption(\'aiExclude\', [2]);\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Clfrtip\",\n    \"oColVis\": {\n        \"aiExclude\": [2]\n    }\n}\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withColVisStateChange(fnStateChange)</code></td>\n            <td>\n                <p>Set the state change function.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withColVis();\n        // Add a state change function\n        .withColVisStateChange(function(iColumn, bVisible) {\n            console.log(\'The column\' + iColumn + \' has changed its status to \' + bVisible)\n        });\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Clfrtip\",\n    \"oColVis\": {\n        \"fnStateChange\": function(iColumn, bVisible) {\n            console.log(\'The column\' + iColumn + \' has changed its status to \' + bVisible)\n        }\n    }\n}\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withTableTools(sSwfPath)</code></td>\n            <td>\n                <p>Add <a href=\"https://datatables.net/extras/tabletools/\">TableTools</a> compatibility.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withTableTools(\'vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\')\n});\n</div>\n                <p class=\"text-danger\">\n                    <i class=\"fa fa-warning\"></i>&nbsp;You must provide a valid path to the <code>SWF</code> file (which is provided by the TableTools plugin).\n                </p>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Tlfrtip\",\n    \"oTableTools\": {\n        \"sSwfPath\": \"vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\"\n    }\n}\n</div>\n                <p class=\"text-info\">\n                    <i class=\"fa fa-info-circle\"></i>&nbsp;By calling this API, the letter <code>T</code> is appended to the <a href=\"http://datatables.net/examples/basic_init/dom.html\">DOM positioning</a>.\n                </p>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withTableToolsOption(key, value)</code></td>\n            <td>\n                <p>Add option to the attribute <code>oTableTools</code>.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withTableTools(\'vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\')\n        // Single row selection at a time\n        .withTableTools(\'sRowSelect\', \'single\');\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Tlfrtip\",\n    \"oTableTools\": {\n        \"sSwfPath\": \"vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\",\n        \"sRowSelect\": \"single\"\n    }\n}\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withTableToolsButtons(aButtons)</code></td>\n            <td>\n                <p>Set the table tools buttons to display.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withTableTools(\'vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\')\n        // Single row selection at a time\n        .withTableToolsButtons([\n            \'copy\',\n            \'print\', {\n                \'sExtends\': \'collection\',\n                \'sButtonText\': \'Save\',\n                \'aButtons\': [\'csv\', \'xls\', \'pdf\']\n            }\n        ]);\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"Tlfrtip\",\n    \"oTableTools\": {\n        \"sSwfPath\": \"https://github.com/DataTables/TableTools/raw/master/swf/copy_csv_xls_pdf.swf\",\n        \"aButtons\": [\n            \'copy\',\n            \'print\', {\n            \'sExtends\': \'collection\',\n                \'sButtonText\': \'Save\',\n                \'aButtons\': [\'csv\', \'xls\', \'pdf\']\n            }\n        ]\n    }\n}\n</div>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withDOM(sDom)</code></td>\n            <td>\n                <p>Override the <a href=\"http://datatables.net/examples/basic_init/dom.html\">DOM positioning</a> of the DataTable.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.newOptions()\n        .withDOM(\'pitrfl\');\n});\n</div>\n                <p class=\"text-info\">\n                    <i class=\"fa fa-info-circle\"></i>&nbsp;By default, the DOM positioning is set to <code>lfrtip</code>.\n                </p>\n            </td>\n        </tr>\n        <tr>\n            <td><code>DTOptions</code></td>\n            <td><code>withScroller()</code></td>\n            <td>\n                <p>Add <a href=\"http://datatables.net/extensions/scroller/\">Scroller</a> compatibility.</p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\'])\n.controller(\'myCtrl\', function ($scope, DTOptionsBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withScroller();\n});\n</div>\n                <p>\n                    The above code will construct the following DataTables options:\n                </p>\n<div hljs language=\"json\">\n{\n    \"sAjaxSource\": \"data.json\",\n    \"sDom\": \"lfrtipS\"\n}\n</div>\n                <p class=\"text-info\">\n                    <i class=\"fa fa-info-circle\"></i>&nbsp;By calling this API, the letter <code>S</code> is appended to the <a href=\"http://datatables.net/examples/basic_init/dom.html\">DOM positioning</a>.\n                </p>\n            </td>\n        </tr>\n        </tbody>\n    </table>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/basic/angularWay.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;The Angular way</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            You can construct your table the \"angular\" way, eg using the directive <code>ng-repeat</code> on <code>tr</code> tag.\n            All you need to do is to add the directive <code>datatable</code> with the value <code>ng</code> on your table in order\n            to make it rendered with DataTables.\n        </p>\n        <p>\n            <strong>Note:</strong>\n        </p>\n        <ul>\n            <li>\n                If you use the Angular way of rendering the table along with the Ajax or the promise solution, the latter\n                will be display.\n            </li>\n            <li>\n                Don\'t forget to set the properties <code>ng</code> in the directive <code>datatable</code> in order to tell the directive to use the Angular way!\n            </li>\n            <li class=\"text-warning\">\n                <i class=\"fa fa-warning\"></i>&nbsp;As of v0.1.0, the directive <code>dtRows</code> is deprecated.\n                This directive is no longer needed. It will be removed completely from v0.2.0\n            </li>\n        </ul>\n        <div class=\"alert alert-danger\">\n            <p>\n                The \"Angular way\" is <strong>REALLY less efficient</strong> than fetching the data with the Ajax/promise solutions. The lack of\n                performance is due to the fact that Angular add the 2 way databinding to the data, where the ajax and promise solutions\n                do not. However, you can use Angular directives (<code>ng-click</code>, <code>ng-controller</code>...) in there!\n            </p>\n            <p>\n                If your DataTable has a lot of rows, I <strong>STRONGLY</strong> advice you to use the Ajax solutions.\n            </p>\n        </div>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"angularWayCtrl\">\n                        <table datatable=\"ng\" class=\"row-border hover\">\n                            <thead>\n                            <tr>\n                                <th>ID</th>\n                                <th>FirstName</th>\n                                <th>LastName</th>\n                            </tr>\n                            </thead>\n                            <tbody>\n                            <tr ng-repeat=\"person in persons\">\n                                <td>{{ person.id }}</td>\n                                <td>{{ person.firstName }}</td>\n                                <td>{{ person.lastName }}</td>\n                            </tr>\n                            </tbody>\n                        </table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"angularWayCtrl\">\n    <table datatable=\"ng\" class=\"row-border hover\">\n        <thead>\n        <tr>\n            <th>ID</th>\n            <th>FirstName</th>\n            <th>LastName</th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr ng-repeat=\"person in persons\">\n            <td>{{ person.id }}</td>\n            <td>{{ person.firstName }}</td>\n            <td>{{ person.lastName }}</td>\n        </tr>\n        </tbody>\n    </table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'ngResource\', \'datatables\']).controller(\'angularWayCtrl\', function ($scope, $resource) {\n    $scope.persons = $resource(\'data.json\').query();\n});\n</div>\n            </tab>\n            <tab heading=\"Example data\">\n                <p class=\"example-data\">\n                    <a target=\"_blank\" href=\"/angular-datatables/data.json\" tooltip=\"data.json\">data.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                </p>\n<div hljs language=\"json\">\n[{\n    \"id\": 860,\n    \"firstName\": \"Superman\",\n    \"lastName\": \"Yoda\"\n}, {\n    \"id\": 870,\n    \"firstName\": \"Foo\",\n    \"lastName\": \"Whateveryournameis\"\n}, {\n    \"id\": 590,\n    \"firstName\": \"Toto\",\n    \"lastName\": \"Titi\"\n}, {\n    \"id\": 803,\n    \"firstName\": \"Luke\",\n    \"lastName\": \"Kyle\"\n},\n...\n]\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/basic/angularWayWithOptions.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;The Angular way with options</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            You can also provide datatable options and datatable column options with the directive\n            <code>dt-options</code>:\n        </p>\n        <p>\n            <strong>Note:</strong>\n        </p>\n        <ul>\n            <li>\n                The options do not override what you define in your template. It will just append its properties.\n            </li>\n            <li class=\"text-danger\">\n                When using the angular way, you CANNOT use the <code>dt-column</code> directive. Indeed,\n                the module will render the datatable after the promise is resolved. So for DataTables, it\'s like rendering a static table.\n                If you need to provide some options to your columnn, your must provide the <code>dt-column-defs</code> directive (which corresponds\n                to the <a href=\"https://datatables.net/reference/option/columnDefs\">DataTables columnDefs</a>).\n            </li>\n        </ul>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"angularWayWithOptionsCtrl\">\n                        <table datatable=\"ng\" dt-options=\"dtOptions\" dt-column-defs=\"dtColumnDefs\" class=\"row-border hover\">\n                            <thead>\n                            <tr>\n                                <th>ID</th>\n                                <th>FirstName</th>\n                                <th>LastName</th>\n                            </tr>\n                            </thead>\n                            <tbody>\n                            <tr ng-repeat=\"person in persons\">\n                                <td>{{ person.id }}</td>\n                                <td>{{ person.firstName }}</td>\n                                <td>{{ person.lastName }}</td>\n                            </tr>\n                            </tbody>\n                        </table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"angularWayWithOptionsCtrl\">\n    <table datatable=\"ng\" dt-options=\"dtOptions\" dt-column-defs=\"dtColumnDefs\" class=\"row-border hover\">\n        <thead>\n        <tr>\n            <th>ID</th>\n            <th>FirstName</th>\n            <th>LastName</th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr ng-repeat=\"person in persons\">\n            <td>{{ person.id }}</td>\n            <td>{{ person.firstName }}</td>\n            <td>{{ person.lastName }}</td>\n        </tr>\n        </tbody>\n    </table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'ngResource\', \'datatables\'])\n.controller(\'angularWayWithOptionsCtrl\', function ($scope, $resource, DTOptionsBuilder, DTColumnDefBuilder) {\n    $scope.persons = $resource(\'data.json\').query();\n    $scope.dtOptions = DTOptionsBuilder.newOptions().withPaginationType(\'full_numbers\').withDisplayLength(2);\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0),\n        DTColumnDefBuilder.newColumnDef(1).notVisible(),\n        DTColumnDefBuilder.newColumnDef(2).notSortable()\n    ];\n});\n</div>\n            </tab>\n            <tab heading=\"Example data\">\n                <p class=\"example-data\">\n                    <a target=\"_blank\" href=\"/angular-datatables/data.json\" tooltip=\"data.json\">data.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                </p>\n<div hljs language=\"json\">\n[{\n    \"id\": 860,\n    \"firstName\": \"Superman\",\n    \"lastName\": \"Yoda\"\n}, {\n    \"id\": 870,\n    \"firstName\": \"Foo\",\n    \"lastName\": \"Whateveryournameis\"\n}, {\n    \"id\": 590,\n    \"firstName\": \"Toto\",\n    \"lastName\": \"Titi\"\n}, {\n    \"id\": 803,\n    \"firstName\": \"Luke\",\n    \"lastName\": \"Kyle\"\n},\n...\n]\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/basic/overrideLoadingTpl.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Override <code>Loading</code> template</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            When loading data, the angular module will display by default <code>&lt;h3 class=\"dt-loading\"&gt;Loading...&lt;/h3&gt;</code>.\n        </p>\n        <p>\n            You can make your own custom loading html by override the <code>DTLoadingTemplate</code> like this:\n        </p>\n    </section>\n    <section class=\"showcase no-tab\">\n<div hljs>\nangular.module(\'datatablesSampleApp\', [\'datatables\']).\nfactory(\'DTLoadingTemplate\', function() {\n    return {\n        html: \'<img src=\"images/loading.gif\" />\'\n    };\n});\n</div>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/basic/withAjax.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With ajax</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            You can also fetch the data from a server using an Ajax call.\n        </p>\n        <p>\n            The <code>angular-datatables</code> provides the helper <code>DTOptionsBuilder.withSource(sAjaxSource)</code>\n            and the helper <code>DTColumnBuilder</code> that lets you build the datatables options for each column.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\" ng-controller=\"withAjaxCtrl\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div>\n                        <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"withAjaxCtrl\">\n    <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\']).controller(\'withAjaxCtrl\', function ($scope, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\');\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\').notVisible()\n    ];\n});\n</div>\n            </tab>\n            <tab heading=\"Example data\">\n                <p class=\"example-data\">\n                    <a target=\"_blank\" href=\"/angular-datatables/data.json\" tooltip=\"data.json\">data.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                </p>\n<div hljs language=\"json\">\n[{\n    \"id\": 860,\n    \"firstName\": \"Superman\",\n    \"lastName\": \"Yoda\"\n}, {\n    \"id\": 870,\n    \"firstName\": \"Foo\",\n    \"lastName\": \"Whateveryournameis\"\n}, {\n    \"id\": 590,\n    \"firstName\": \"Toto\",\n    \"lastName\": \"Titi\"\n}, {\n    \"id\": 803,\n    \"firstName\": \"Luke\",\n    \"lastName\": \"Kyle\"\n},\n...\n]\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/basic/withOptions.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With options</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> provides the helper <code>DTOptionsBuilder</code> that lets you build the datatables options.\n        </p>\n        <p>\n            It also provides the helper <code>DTColumnBuilder</code> that lets you build the column and column defs options.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helpers.\n        </p>\n        <p>\n            <strong>Note:</strong>\n        </p>\n        <ul>\n            <li class=\"text-danger\">\n                <i class=\"fa fa-warning\"></i>&nbsp;When rendering a static table, you CANNOT use the <code>dt-column</code> directive. Indeed,\n                the module will render the datatable after the promise is resolved. So for DataTables, it\'s like rendering a static table.\n                If you need to provide some options to your columnn, your must provide the <code>dt-column-defs</code> directive (which corresponds\n                to the <a href=\"https://datatables.net/reference/option/columnDefs\">DataTables columnDefs</a>).\n            </li>\n        </ul>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"withOptionsCtrl\">\n                        <table datatable dt-options=\"dtOptions\" dt-column-defs=\"dtColumnDefs\" class=\"row-border hover\">\n                            <thead>\n                            <tr>\n                                <th>ID</th>\n                                <th>First name</th>\n                                <th>Last name</th>\n                            </tr>\n                            </thead>\n                            <tbody>\n                            <tr>\n                                <td>1</td>\n                                <td>Foo</td>\n                                <td>Bar</td>\n                            </tr>\n                            <tr>\n                                <td>123</td>\n                                <td>Someone</td>\n                                <td>Youknow</td>\n                            </tr>\n                            <tr>\n                                <td>987</td>\n                                <td>Iamout</td>\n                                <td>Ofinspiration</td>\n                            </tr>\n                            </tbody>\n                        </table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"withOptionsCtrl\">\n    <table datatable dt-options=\"dtOptions\" dt-column-defs=\"dtColumnDefs\" class=\"row-border hover\">\n        <thead>\n        <tr>\n            <th>ID</th>\n            <th>First name</th>\n            <th>Last name</th>\n        </tr>\n        </thead>\n        <tbody>\n        <tr>\n            <td>1</td>\n            <td>Foo</td>\n            <td>Bar</td>\n        </tr>\n        <tr>\n            <td>123</td>\n            <td>Someone</td>\n            <td>Youknow</td>\n        </tr>\n        <tr>\n            <td>987</td>\n            <td>Iamout</td>\n            <td>Ofinspiration</td>\n        </tr>\n        </tbody>\n    </table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\']).controller(\'withOptionsCtrl\', function ($scope, DTOptionsBuilder, DTColumnDefBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.newOptions()\n        .withPaginationType(\'full_numbers\')\n        .withDisplayLength(2)\n        .withDOM(\'pitrfl\');\n    $scope.dtColumnDefs = [\n        DTColumnDefBuilder.newColumnDef(0).notSortable(),\n        DTColumnDefBuilder.newColumnDef(1).notVisible(),\n        DTColumnDefBuilder.newColumnDef(2)\n    ];\n});\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/basic/withPromise.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With a function that returns a promise</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            You can also fetch the data from a server using a function that returns a promise.\n        </p>\n        <p>\n            The <code>angular-datatables</code> provides the helper <code>DTOptionsBuilder.withFnPromise(fnPromise)</code>\n            and the helper <code>DTColumnBuilder</code> that lets you build the datatables options for each column.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"withPromiseCtrl\">\n                        <table datatable=\"\" dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<div ng-controller=\"withPromiseCtrl\">\n    <table datatable=\"\" dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n</div>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'ngResource\', \'datatables\'])\n.controller(\'withPromiseCtrl\', function ($scope, DTOptionsBuilder, DTColumnBuilder, $resource) {\n    $scope.dtOptions = DTOptionsBuilder.fromFnPromise(function() {\n            return $resource(\'data.json\').query().$promise;\n        }).withPaginationType(\'full_numbers\');\n\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\').notVisible()\n    ];\n});\n</div>\n            </tab>\n            <tab heading=\"Example data\">\n                <p class=\"example-data\">\n                    <a target=\"_blank\" href=\"/angular-datatables/data.json\" tooltip=\"data.json\">data.json&nbsp;<i class=\"fa fa-external-link\"></i></a>\n                </p>\n<div hljs language=\"json\">\n[{\n    \"id\": 860,\n    \"firstName\": \"Superman\",\n    \"lastName\": \"Yoda\"\n}, {\n    \"id\": 870,\n    \"firstName\": \"Foo\",\n    \"lastName\": \"Whateveryournameis\"\n}, {\n    \"id\": 590,\n    \"firstName\": \"Toto\",\n    \"lastName\": \"Titi\"\n}, {\n    \"id\": 803,\n    \"firstName\": \"Luke\",\n    \"lastName\": \"Kyle\"\n},\n...\n]\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/basic/zeroConfig.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Zero configuration</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> provides a <code>datatables</code> directive you can add to your <code>&lt;table&gt;</code>:\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <table datatable class=\"row-border hover\">\n                        <thead>\n                        <tr>\n                            <th>ID</th>\n                            <th>First name</th>\n                            <th>Last name</th>\n                        </tr>\n                        </thead>\n                        <tbody>\n                        <tr>\n                            <td>1</td>\n                            <td>Foo</td>\n                            <td>Bar</td>\n                        </tr>\n                        <tr>\n                            <td>123</td>\n                            <td>Someone</td>\n                            <td>Youknow</td>\n                        </tr>\n                        <tr>\n                            <td>987</td>\n                            <td>Iamout</td>\n                            <td>Ofinspiration</td>\n                        </tr>\n                        </tbody>\n                    </table>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<table datatable class=\"row-border hover\">\n    <thead>\n    <tr>\n        <th>ID</th>\n        <th>First name</th>\n        <th>Last name</th>\n    </tr>\n    </thead>\n    <tbody>\n    <tr>\n        <td>1</td>\n        <td>Foo</td>\n        <td>Bar</td>\n    </tr>\n    <tr>\n        <td>123</td>\n        <td>Someone</td>\n        <td>Youknow</td>\n    </tr>\n    <tr>\n        <td>987</td>\n        <td>Iamout</td>\n        <td>Ofinspiration</td>\n    </tr>\n    </tbody>\n</table>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\']);\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/partials/gettingStarted.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-gear\"></i>&nbsp;Getting started</h1>\n    </header>\n    <section class=\"article-content\">\n        <section>\n            <h3>Dependencies</h3>\n            <p>\n                The <strong>required dependencies</strong> are:\n            </p>\n            <ul>\n                <li><a href=\"http://angular.org\">AngularJS</a> (tested with version 1.2.6)</li>\n                <li><a href=\"http://jquery.com\">JQuery</a> (tested with version 1.11.0)</li>\n                <li><a href=\"https://datatables.net\">Datatables</a> (tested with version 1.9.4 and 1.10+)</li>\n            </ul>\n            <p>\n                This module has been tested with the following datatables modules:\n            </p>\n            <ul>\n                <li><a href=\"https://datatables.net/extras/colreorder/\">ColReorder</a> with version 1.1.0</li>\n                <li><a href=\"https://datatables.net/extras/colvis/\">ColVis</a> with version 1.1.0</li>\n                <li><a href=\"https://datatables.net/extras/tabletools/\">TableTools</a> with version 2.2.0</li>\n            </ul>\n        </section>\n        <hr />\n        <section>\n            <h3>Download</h3>\n            <h4>Manually</h4>\n            <p>\n                The files can be downloaded on <a href=\"https://github.com/l-lin/angular-datatables/archive/master.zip\"><i class=\"fa fa-github\"></i>&nbsp;GitHub</a>.\n            </p>\n            <h4>With <a href=\"http://bower.io\">Bower</a></h4>\n<div hljs language=\"bash\">\n$ bower install angular-datatables\n</div>\n        </section>\n        <hr />\n        <section>\n            <h3>Installation</h3>\n            <p>\n                Include the JS file in your <code>index.html</code> file:\n                <br />\n            </p>\n<div hljs language=\"html\">\n<script src=\"jquery.min.js\"></script>\n<script src=\"jquery.dataTables.min.js\"></script>\n<script src=\"angular.min.js\"></script>\n<script src=\"angular-datatables.min.js\"></script>\n</div>\n            <p class=\"text-danger\">\n                <i class=\"fa fa-warning\"></i>&nbsp;You must include the JS file in this order. AngularJS <strong>MUST</strong> use <code>jQuery</code> and not its <code>jqLite</code>!\n            </p>\n            <p>\n                Declare dependencies on your module app like this:\n            </p>\n<div hljs language=\"js\">\nangular.module(\'myModule\', [\'datatables\']);\n</div>\n        </section>\n        <hr />\n        <section>\n            <h3>Additional Notes</h3>\n            <ul>\n                <li>\n                    <a href=\"http://requirejs.org/\">RequireJS</a> is not supported.\n                </li>\n                <li>\n                    <p>\n                        Each time a datatable is rendered, a message is sent to the parent scopes with the id of the table and the DataTable itself.\n                        <br />\n                        For instance, for the given dataTable:\n                    </p>\n<div hljs language=\"html\">\n<table id=\"foobar\" datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\"></table>\n</div>\n                    <p>\n                        You can catch the event like this in your parent directive or controller:\n                    </p>\n<div hljs language=\"js\">\n$scope.$on(\'event:dataTableLoaded\', function(event, loadedDT) {\n    // loadedDT === {\"id\": \"foobar\", \"DataTable\": oTable, \"dataTable\": $oTable}\n\n    // loadedDT.DataTable is the DataTable API instance\n    // loadedDT.dataTable is the jQuery Object\n    // See http://datatables.net/manual/api#Accessing-the-API\n});\n</div>\n                </li>\n                <li>\n                    <p>\n                        <code>Angular Datatables</code> is using <a href=\"https://developer.mozilla.org/fr/docs/Web/JavaScript/Reference/Objets_globaux/Object/create\"><code>Object.create()</code></a> to instanciate options and columns.\n                    </p>\n                    <p>\n                        If you need to support IE8, then you need to add this <a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Object/create#Polyfill\"><code>Polyfill</code></a>.\n                    </p>\n                </li>\n            </ul>\n\n        </section>\n    </section>\n    <section class=\"showcase\"></section>\n</article>\n");
