$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/partials/welcome.html","<article class=\"main-content welcome\">\n    <header class=\"article-header\">\n        <h1><a href=\"https://angularjs.org/\"><img src=\"../../images/AngularJS.png\" /></a></h1>\n        <h1 class=\"text-info notice\">Structural framework for dynamic web apps</h1>\n        <h1><i class=\"fa fa-plus\"></i></h1>\n        <h1><a href=\"https://datatables.net/\"><img src=\"../../images/DataTables.png\" />&nbsp;DataTables</a></h1>\n        <h1 class=\"text-info notice\">jQuery plug-in for complex HTML tables</h1>\n    </header>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/withPlugins/bootstrapIntegration.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Bootstrap integration</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            Angular Datables can also be compatible with <a href=\"http://getbootstrap.com\">Twitter Bootstrap 3</a>.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"bootstrapIntegrationCtrl\">\n                        <table datatable=\"\" dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"table table-striped table-bordered\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"vendor/bootstrap/dist/css/bootstrap.min.css\">\n<!-- ... -->\n<div ng-controller=\"bootstrapIntegrationCtrl\">\n    <table datatable=\"\" dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"table table-striped table-bordered\"></table>\n</div>\n<!-- ... -->\n<script src=\"vendor/bootstrap/dist/js/bootstrap.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\']).controller(\'bootstrapIntegrationCtrl\', function ($scope, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.dtOptions = DTOptionsBuilder\n        .fromSource(\'data.json\')\n        // Add Bootstrap compatibility\n        .withBootstrap();\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\').withClass(\'text-danger\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n});\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/withPlugins/overrideBootstrapOptions.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;Override Bootstrap options</h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            With bootstrap integration, angular-datatables overrides classes so that it uses Bootstrap classes instead of DataTables\'.\n            However, you can also override the classes used by using the helper <code>DTOption.withBootstrapOptions</code>.\n        </p>\n        <p>\n            <i class=\"fa fa-info-circle\"></i>&nbsp;Angular-datatables provides default properties for Bootstrap compatibility.\n            You can check them out on <a href=\"https://github.com/l-lin/angular-datatables/blob/dev/src/angular-datatables.bootstrap.options.js\">Github</a>.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"withBootstrapOptionsCtrl\">\n                        <table datatable=\"\" dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"table table-striped table-bordered\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"vendor/bootstrap/dist/css/bootstrap.min.css\">\n<!-- ... -->\n<div ng-controller=\"withBootstrapOptionsCtrl\">\n    <table datatable=\"\" dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"table table-striped table-bordered\"></table>\n</div>\n<!-- ... -->\n<script src=\"vendor/bootstrap/dist/js/bootstrap.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\']).controller(\'bootstrapIntegrationCtrl\', function ($scope, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.dtOptions = DTOptionsBuilder\n        .fromSource(\'data.json\')\n        // Add Bootstrap compatibility\n        .withBootstrap()\n        // Overriding the classes\n        .withBootstrapOptions({\n            TableTools: {\n                classes: {\n                    container: \'btn-group\',\n                    buttons: {\n                        normal: \'btn btn-danger\'\n                    }\n                }\n            },\n            ColVis: {\n                classes: {\n                    masterButton: \'btn btn-primary\'\n                }\n            }\n        })\n\n        // Add ColVis compatibility\n        .withColVis()\n\n        // Add Table tools compatibility\n        .withTableTools(\'vendor/datatables-tabletools/swf/copy_csv_xls_pdf.swf\')\n        .withTableToolsButtons([\n            \'copy\',\n            \'print\', {\n            \'sExtends\': \'collection\',\n            \'sButtonText\': \'Save\',\n            \'aButtons\': [\'csv\', \'xls\', \'pdf\']\n        }\n    ]);\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\').withClass(\'text-danger\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n});\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.2.x/demo/withPlugins/withColReorder.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/colreorder/\">ColReorder</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>ColReorder</code> works with datatables.\n        </p>\n        <p>\n            See the <a ui-sref=\"api\">API</a> for the complete list of methods of the helper.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"withColReorderCtrl\">\n                        <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"vendor/datatables-colreorder/css/dataTables.colReorder.css\">\n<!-- ... -->\n<div ng-controller=\"withColReorderCtrl\">\n    <table datatable dt-options=\"dtOptions\" dt-columns=\"dtColumns\" class=\"row-border hover\"></table>\n</div>\n<!-- ... -->\n<script src=\"vendor/datatables-colreorder/js/dataTables.colReorder.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'datatablesSampleApp\', [\'datatables\']).controller(\'withColReorderCtrl\', function ($scope, DTOptionsBuilder, DTColumnBuilder) {\n    $scope.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        // Activate col reorder plugin\n        .withColReorder()\n        // Set order\n        .withColReorderOrder([1, 0, 2])\n        // Fix last right column\n        .withColReorderOption(\'iFixedColumnsRight\', 1)\n        .withColReorderCallback(function() {\n            console.log(\'Columns order has been changed with: \' + this.fnOrder());\n        });\n    $scope.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'No move me!\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'Try to move me!\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'You cannot move me! *evil laugh*\')\n    ];\n});\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
