$templateCache.put("components/angular-datatables-master/archives/v0.4.x/demo/withPlugins/withFixedHeader.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/fixedheader/\">Fixed Header</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            The <code>angular-datatables</code> also provides an API in order to make the plugin <code>FixedHeader</code> work with datatables.\n        </p>\n        <p>\n            You need to add the file <code>angular-datatables.fixedheader.min.js</code> to your HTML file.\n        </p>\n        <p>\n            You also need to add the dependency <code>datatables.fixedheader</code> to your Angular app.\n        </p>\n        <div class=\"api alert alert-danger\">\n            <p>\n                <i class=\"fa fa-warning\"></i>&nbsp;Beware when using routers. It seems that the header and footer stay\n                in your DOM even when you change your application state. So you will need to tweak your code to remove them\n                when exiting the state.\n            </p>\n            <p>\n                For example, if you are using <a href=\"https://github.com/angular-ui/ui-router\">Angular ui-router</a>, you can\n                add an <code>onExit</code> callback like this:\n            </p>\n            <br />\n<div hljs>\n$stateProvider.state(\"contacts\", {\n    templateUrl: \'somewhereInDaSpace\',\n    controller: function($scope, title){\n        // Do your stuff\n    },\n    onEnter: function(title){\n        // Do your stuff\n    },\n    onExit: function(){\n        // Remove the DataTables FixedHeader plugin\'s headers and footers\n        var fixedHeaderEle = document.getElementsByClassName(\'fixedHeader\');\n        angular.element(fixedHeaderEle).remove();\n        var fixedFooterEle = document.getElementsByClassName(\'fixedFooter\');\n        angular.element(fixedFooterEle).remove();\n    }\n});\n</div>\n        </div>\n    </section>\n    <section class=\"showcase\">\n        <div ng-controller=\"WithFixedHeaderCtrl as showCase\">\n            <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\">\n                <tfoot>\n                <tr>\n                    <th>ID</th>\n                    <th>First name</th>\n                    <th>Last name</th>\n                </tr>\n                </tfoot>\n            </table>\n        </div>\n        <tabset>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"vendor/datatables-fixedheader/css/dataTables.fixedHeader.css\">\n<!-- ... -->\n<div ng-controller=\"WithFixedHeaderCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\">\n        <tfoot>\n        <tr>\n            <th>ID</th>\n            <th>First name</th>\n            <th>Last name</th>\n        </tr>\n        </tfoot>\n    </table>\n</div>\n<!-- ... -->\n<script src=\"vendor/datatables-fixedheader/js/dataTables.fixedHeader.js\"></script>\n<script src=\"vendor/angular-datatables/dist/plugins/fixedheader/angular-datatables.fixedheader.min.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withFixedHeader\', [\'datatables\', \'datatables.fixedheader\'])\n.controller(\'WithFixedHeaderCtrl\', WithFixedHeaderCtrl);\n\nfunction WithFixedHeaderCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        .withDisplayLength(25)\n        .withFixedHeader({\n            bottom: true\n        });\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
$templateCache.put("components/angular-datatables-master/archives/v0.4.x/demo/withPlugins/withResponsive.html","<article class=\"main-content\">\n    <header class=\"article-header\">\n        <h1><i class=\"fa fa-play\"></i>&nbsp;With the DataTables <a href=\"https://datatables.net/extensions/responsive/\">Responsive</a></h1>\n    </header>\n    <section class=\"article-content\">\n        <p>\n            You can easily add the DataTables <code>Responsive</code> plugin. Include the <a href=\"//cdn.datatables.net/responsive/1.0.1/js/dataTables.responsive.js\">JS file</a> and\n            <a href=\"//cdn.datatables.net/responsive/1.0.1/css/dataTables.responsive.css\">CSS file</a>. Then set the <code>responsivce</code> option to <code>true</code>.\n        </p>\n        <p class=\"alert alert-warning\">\n            <i class=\"fa fa-warning\"></i>&nbsp;The API <code>DTColumn.notVisible()</code> does not work in this case. Use <code>DTColumn.withClass(\'none\')</code> instead.\n        </p>\n    </section>\n    <section class=\"showcase\">\n        <tabset>\n            <tab heading=\"Preview\">\n                <article class=\"preview\">\n                    <div ng-controller=\"WithResponsiveCtrl as showCase\">\n                        <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\" width=\"100%\"></table>\n                    </div>\n                </article>\n            </tab>\n            <tab heading=\"HTML\">\n<div hljs>\n<link rel=\"stylesheet\" href=\"vendor/datatables-responsive/css/dataTables.responsive.css\">\n<!-- ... -->\n<div ng-controller=\"WithResponsiveCtrl as showCase\">\n    <table datatable dt-options=\"showCase.dtOptions\" dt-columns=\"showCase.dtColumns\" class=\"row-border hover\" width=\"100%\"></table>\n</div>\n<!-- ... -->\n<script src=\"vendor/datatables-responsive/js/dataTables.responsive.js\"></script>\n</div>\n            </tab>\n            <tab heading=\"JS\">\n<div hljs language=\"js\">\nangular.module(\'showcase.withResponsive\', [\'datatables\'])\n.controller(\'WithResponsiveCtrl\', WithResponsiveCtrl);\n\nfunction WithResponsiveCtrl(DTOptionsBuilder, DTColumnBuilder) {\n    var vm = this;\n    vm.dtOptions = DTOptionsBuilder.fromSource(\'data.json\')\n        .withPaginationType(\'full_numbers\')\n        // Active Responsive plugin\n        .withOption(\'responsive\', true);\n    vm.dtColumns = [\n        DTColumnBuilder.newColumn(\'id\').withTitle(\'ID\'),\n        DTColumnBuilder.newColumn(\'firstName\').withTitle(\'First name\'),\n        // .notVisible() does not work in this case. Use .withClass(\'none\') instead\n        DTColumnBuilder.newColumn(\'lastName\').withTitle(\'Last name\').withClass(\'none\')\n    ];\n}\n</div>\n            </tab>\n        </tabset>\n    </section>\n</article>\n");
